select ?start ?end (count(?mid) as ?length)
where {
  values (?start ?end) { (<http://dbpedia.org/resource/Dunstable> <http://dbpedia.org/resource/Luton>) }
  ?start :p  ?mid .
  ?mid :p* ?end .
}
group by ?start ?end
